import React from 'react';
import './App.css';

import ThemeChanger from './components/ThemeChanger'
import Filter from './components/Filter'
import AddTodo from './containers/AddTodo'
import VisibleTodoList from './containers/VisibleTodoList'

function App() {

  return (
    <div className="App">
      <ThemeChanger/>
      <AddTodo/>
      <VisibleTodoList/>
      <Filter/>
    </div>
  );
}

export default App;
